import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import './index.css';
import {Link} from 'react-router-dom';




function DeasSixComponent() {
    return (
        <div>
            <h3 className='center3'>Awards</h3>
            <h4>ENG</h4>
            <Link to="/ward/one">
                <button className='b1'>
                Awards Descriptions
                </button>
            </Link>
            <h4>KAZ</h4>
            <Link to="/soft/one">
                <button className='b1'>
                Марапаттардың сипаттамасы
                </button>
            </Link>
            <h4>RUS</h4>
            <Link to="/soft/one">
                <button className='b1'>
                Описания наград
                </button>
            </Link>

        </div>
    );
}

export default DeasSixComponent;
